import { useState } from 'react'

import logo from './logo.svg';
import './App.css';

function App() {
  const [username, setUsername] = useState('')

  return (
    <div>
      <h1>Register</h1>
        <form>
          <input
            value={username}
            onChange={(e) => setUsername(e.target.value)} 
            type="text" 
            placeholder="Username" />
          <input type="text" placeholder="Passwprd" />
        </form>
    </div>
  );
}

export default App;
